var tipuesearch = {"pages":[{"title":"About","text":"2018 Fall 分組網誌 課程倉儲: https://github.com/mdecourse/2018fall 課程投影片: https://mdecourse.github.io/2018fall/reveal 課程網誌: https://mdecourse.github.io/2018fall/blog","tags":"misc","url":"https://mdecadp2018.github.io/site-40623224/blog/pages/about/"},{"title":"Week-9","text":"W9 期中考週~ 六人分組 期中自評:83","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W9.html"},{"title":"Week-8","text":"Onshape 與電腦輔助設計 學習要點: 1.An introduction to engineering drawings( 工程圖紙簡介 ) 2.Creating drawing views, dimensioning, tolerancing, notes(創建圖紙視圖，尺寸標註，公差，筆記) 3.Using formats/templates(使用格式/模板) 4.Introducing GTOL/GD&T(介紹GTOL / GD＆T) 心得: 這一週課程是讓我們題交推送之前尚未完成的Week，並知道自己學到哪裡，然而期中考過後準備分組課程，一組以六個人為單位，這八週，從學習github到繪製Onshape，再到可以熟練繪製Onshape，然而了解一些畫法，找出因應方法，接下來就是開始準備期中過後的課程了~","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W8.html"},{"title":"Week-7","text":"上課前在登陸 Github 時，發現故障，無法使用，找出方法解決並探討問題 學習要點: 1.Lesson on degrees of freedom ( 自由度 ) 2.An introduction to assembly Mates ( 介紹配合組件 ) 3.Mate Connectors ( 配合連接器 ) 4.Manipulating part position with the triad ( 用三合一操縱零件位置 ) 5.Explaining Mates and Relations ( 解釋配合和關係 ) 6.Animating Mates ( 動畫配合 ) 7.An introduction to Linked Documents ( 介紹相關聯的文件 ) 8.Applying limits to a Mate ( 對配合施加限制 ) 心得: 由於github在這禮拜突然故障，所以老師找出其他方法解決並探討，起初發現github沒辦法登入，本來以為自己推送成功，後來跑去看自己的倉儲才看到自己根本沒有推送東西上去，聽到老師說才知道是壞掉的問題，老師推論說github是因為在更換伺服器所以才暫時性無法使用，如果不是這個問題的話可能之後都要讓我們使用Fossli SCM 。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W7.html"},{"title":"Week-6","text":"將倉儲中的 flaskapp.py 更新至最新版本 將倉儲中的 flaskapp.py 更新至最新版本 搜尋 github cmsimfly 心得: 瞭解老師給予的Onshape教材中的一些專屬名詞，把不懂的單字記錄下來，如果遇到這個單字時能夠迅速找到它的中文解釋，以及如何更新最新的CMSimfly，不然更新自己網站的內容時，因為某些原因導致 https://localhost:8443 一直出現錯誤而無法使用，還有討論到有關人事時地物等關鍵內容的架構安排。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W6.html"},{"title":"Week-5","text":"Onshape week 2 課程使用說明 學習要點: 1.簡介\"設計意圖\" (design intent) 2.設定尺寸 (dimensions) 與約束 (constraints) 3.自動推理 (automatic inferencing) 4.繪製精確的零件 (accurate part) 5.草圖繪製練習 6.運用與建立平面 (planes) 7.建立圓角 (fillets) 與倒角 (chamfers) 8.使用多個 (multiple) 草圖區域 (sketch regions) 9.基本零件 10.繪製時鐘模型 - 用於設計意圖教學 11.各種簡單的幾何形狀 (geometric shapes) 影片連結: 練習繪製Onahape-Week2-1 練習繪製Onahape-Week2-2 練習繪製Onahape-Week2-3 練習繪製Onahape-Week2-4 練習繪製Onahape-Week2-5 心得: 第五週進入到Onshape第二週，這一週開始必須要了解到自己的設計意圖是什麼，還有設定尺寸以及如何去約束他，並且要正確和精準。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W5.html"},{"title":"Week-4","text":"Onshape week1 課程使用說明 練習繪製Onahape基本步驟 Step1:建立 Onshape 帳號 - 請利用學校 gmail 建立教育版帳號 Step2:3D 環境導航 (navigate) Step3:說明基於草圖 (sketch-based)的建模 Step4:介紹 4 個基本特徵 (features)（擠出(extrude)，旋轉(revolve)，掃描(sweep)，和斷面混成(loaf)） Step5:從 2D 過渡到 3D Step6:介紹基本草圖 Step7:附錄A：鍵盤快捷鍵 (keyboard shotcuts)，滑鼠和觸控平面手勢 (touchpad gestures)，檢視工具 Step8:附錄B：導航說明檔，建立帳號，訂閱計劃 (subscription plans) Step9:圓柱薄殼 (cylinder shell) - 繪圖界面與可視化/檢視的介紹 Step10:針對既有草圖的模型 - 接續建立特徵 Step11:現存公用模型 (public models) - 如何搜尋並復製到工作區 (workspace) 影片連結: 練習繪製Onahape-Week1-1 練習繪製Onahape-Week1-2 練習繪製Onahape-Week1-3 練習繪製Onahape-Week1-4 練習繪製Onahape-Week1-5 練習繪製Onahape-Week1-6 心得: 第四週開始學習Onshape，這一週剛開始讓我自己熟悉一下它的介面，發現其實與其它不同的軟體譬如inventor等等這些軟體相似，然而我從簡單的繪圖開始，到後面使用掃略以及斷面混成，想必只要有心一定學得起來的。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W4.html"},{"title":"Week-3","text":"2018/09/24中秋節放假~ 石頭日式無煙燒肉 散播歡樂散播愛","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W3.html"},{"title":"Week-2","text":"如何以 ShareX 取圖, 如何管理 CMSimfly 作業倉儲 老師旗下的40623224每週學習作業倉儲 Step1:依照Week1先去mde.tw領取個人倉儲 Step2:利用 Settings 將內定 branch 設為 gh-pages Step3: git clone 作業倉儲至近端後, 著手將練習 Onshape 的各項過程資料存入 CMSimfly, Reveal.js 與 Pelican Blog 中 *若要在圖片上加上有顏色的框,對LEO開啟Y:/tmp/40623224/cmsimfly.leo調整顏色粗細大小 心得: 第二週學習如何管理期中作業倉儲的網站內容以及投影片內容，每週必須放上進度，到期中的時候會操作期中考作業，到時去管理自己的倉儲，做法大約是平常上課教的，應該是可以做完。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W2.html"},{"title":"Week-1","text":"如何利用 p37 中的 git 建立個人的 Github Pages 網站 Q&A: Q:什麼是Onshape? A:Onshape是一個現代化的CAD系統，可以消除設計僵局，幫助工程師做最好的工作。Onshape將高級建模工具和設計數據管理結合在一個安全的雲工作空間中，該工作空間已迅速成為全球數千家公司的主要CAD系統。 Q:為什麼選擇Onshape? A:因為Onshape可以主動幫助我們並保護我們的知識產權，而它有七種不同的安全措施(即密碼保護訪問、雙因素認證、數據庫備份程序、專用服務器、通信安全、加密、第三方測試)。 step1:建立一個新的倉庫,名字為自己的學號.github.io,權限設為公開 step2:克隆新的倉庫的網址,資料夾名字取為40623224,按Enter step3:除了.git和README.md不能複製,其餘都複製在自己的資料夾 step4:先看自己的狀態然後增加,再提交,推送的名稱為initial add step5:設定自己提交的email和名字 step6:開啟進端進去修改40623224 step7:在重複step4的步驟,在git push上傳 心得: 第一週開始重新接觸github有點害怕，但是聽老師解說之後其實只是沿用上學期學過的東西，所以我覺得應該是撐得住，但是這學期還多加了一個名叫''Onshape''這套軟件，因為從來沒接觸過所以還是有點害怕，但是聽到老師引用把餐廳的食物(Onshape)吃下去，甚至做得更好吃(學習)，讓我覺得反而不可怕了。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog-W1.html"},{"title":"2018 Fall 分組網誌","text":"2018 Fall 開始將網際內容管理、投影片與網誌進行整合. 課程倉儲 利用 Github 倉儲存放與計算機程式相關的資料, 有幾項好處: 第一, 在不自建網站的情況下, 目前 Github 仍允許免費使用, 管理者除了可以利用網際模式將資料送到對應的 cp github 倉儲 外, 也可以利用近端的 git 客戶端程式, 以分散式版次的流程管理各階段的改版資料. 第二, Github 提供的 Github Pages, 可以讓純 html 加上 Javascript 的網站, 直接在 cp 課程網站 伺服. 第三, 改版後的 CMSimfly, 加上 Pelican 靜態網誌與 Reveal.js 投影片系統, 均為靜態網站資料, 可以直接整合一起, 透過一個網址當作上課參考資料. 該學習哪種程式語言? C/C++、Python、Lua 或 Javascript? 都可以. 在這裡, 學 C/C++ 是為了編寫 Arduino 控制程式, 以及結合 Qt5 建立各種能快速進行工程分析的程式庫, 學習 Python 是為了快速完成 C/C++ 無法迅速完成的分析、模擬與運算, 也能透過 PyQt5 建立視窗程式, 或者呼叫 Flask 建立能在網際環境中執行的協同設計套件. 學習 Lua 是為了能在 V-rep 中使用, 至於 Javascript, 已經無所不在, 尤其在網際成是開發過程, 更是重要, 有其學習的必要性.","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623224/blog/2018-Fall-Project-Blog.html"}]};